        and \"Harry Hood\"-intro-like jamming, and a glorious dying-out-of-the-theme
        ending. This is quite a version.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71403,"track_id":3908,"tag_id":4,"created_at":"2019-04-14T01:01:36.459Z","notes":"Cool,
