        bells or whistles on this \"Hood.\" But the build and peak sections are simply
        gorgeous, even by ''95 standards.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70548,"track_id":12344,"tag_id":4,"created_at":"2019-04-14T01:01:06.770Z","notes":"A
        magnificent jam in this version ends a stellar year for \"Hood.\" Released
        on FTA Superball IX, Part 2.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71900,"track_id":15808,"tag_id":4,"created_at":"2019-04-14T01:01:54.710Z","notes":"Jam
